import React from 'react'
import './Checkbox.scss'

function Checkbox(props) {
    return (
        <div>
            { props.todos.map(todo => {
                return (
                    <div>
                        <input 
                            className='checkbox-custom' 
                            type="checkbox" 

                        />
                        <label 

                        >{todo.title}</label>
                    </div>
                )
            })}



        </div>
    )
}

export default Checkbox
